const Clone = () => {
    return (
        <div>
            <h1>Clone Page</h1>
            <p>This is the Clone page content.</p>
            <p>Chức năng này đang được phát triển.</p>
            <p>Vui lòng quay lại sau.</p>
        </div>
    )
}
export default Clone;
